import s from './Gallery.module.css'
import React from "react";


let Gallery = (props) => {

    let gallery = props.homeGallery.map(e=>

            <div  id={e.id} className={s.itemGallery}>
                <img src={e.img} alt={e.alt}/>
                <input className={s.itemGalleryInput} type="radio" name="point" id={e.id}/>
                <label htmlFor={e.id} />
            </div>


    );

    return(
        <div className={s.blockGallery}>
            <h1 className={s.title}> who we`ve worked with</h1>
            <div className={s.area}>  {gallery} </div>
            <div className={s.visiblArea}>
            </div>





        </div>
    );
};
export default Gallery;
